import react from "react";
import {Link} from "react-router-dom";


function AdminHomePage () {

    const history = useHistory()

    const loginAdmin = () => {
        history.push("/admin-trips-list")
    }
  

return(
    <div>
    <h1>ADMIN PAGE</h1>
    <button onClick={loginAdmin}>Voltar</button>
    </div>
)

}

export default AdminHomePage;
